import React, { Component } from 'react'

class Search extends Component {

    constructor(props){
        super(props)
    }

    render() {
        return (
            <div className="searchForm">
                <form class="card p-2 text-left">
                    <h5>Şarkıcı adı giriniz</h5>
                    <div class="input-group">
                    <input type="text" class="form-control" placeholder="Şarkıcı..." />
                    <div class="input-group-append">
                        <button type="submit" class="btn btn-secondary">Albümleri Getir</button>
                    </div>
                    </div>
                </form>
            </div>
        )
    }
}

export default Search;
